script: |
  super -f text -I q11420.spq | sort > q11420.out

inputs:
  - name: q11420.spq
    data: |
      SELECT DISTINCT - col2 + - col2 + - col0 * + - col2 / col2 * + col1 + col1 * - - col1 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 + - - col1 <> col0 * + col1;
  - name: tab2

outputs:
  - name: q11420.out
    data: |
